    const keys = [];
    for (const key in props.product[0]) {
        keys.push(key)
    }
    return <div>
        {keys.map((item, i) => {
            if (typeof (props.product[0][item]) === 'object') {
                return <li> {props.product[0][item].map(el => el)}</li>
            } else {
                return <li> {props.product[0][item]}</li>
            }
        })}
    </div>
}

export default ProductDetail
